import { mockRentBike } from '../../mockRentBike/mockRentBike'
import {  mockList } from '../../mockList/mockList'

const initialState = {
    list: mockList,
    rent: mockRentBike
};

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case 'CREATE_BIKE':
            return {
                ...state
            }

    
        default:
            return state
    }
};

export default reducer;
